import styles from './AccentImage.module.css';
import React from 'react';

export default function AccentImage({path, position}) {

    return (
        <div className={`${styles.med_img} ${styles.ks_accent_img} ${styles[position]}`}>
            <img src={path}
                 className={`${styles.med_img} 
                ${styles.circle} 
                ${styles.relative}`}
                 alt={'Image showing a likeness of Kytra.'}/>
        </div>
    );
}
